import React, {useState} from 'react';
import Header from './header'
import TableHolder from './TableHolder';
import DataBox from './dataBox';
import {atomicContext} from '../Contexts/atomicContexts'

function App(){
  const [atomicNum, setatomicNum] = useState(0);
  setatomicNum(4);
  //console.log("xxxx" + atomicNum)
  return( <div>

      <Header/>
    <atomicContext.Provider value = {atomicNum, setatomicNum}>
      <DataBox/>
      <TableHolder/>
    </atomicContext.Provider>
  </div>
  )

};

export default App;
